    <script>
        var url = window.location.href;
        // get the video URL from ?url= parameter

        var videoUrl = url.split('?url=')[1];
        if(videoUrl == undefined) {
            alert('Video URL not found');
        }
        // redirect to the download page after processing the video URL of 5 seconds
        setTimeout(() => {
            window.location.href = videoUrl;
        }, 5000);
